            <CustomLink to="features" spy={true} smooth={true} duration={500}>Features</CustomLink>
            <CustomLink to="contact" spy={true} smooth={true} duration={500}>Contact</CustomLink> */}
        </ul>
    </nav>
    </div>
)



}

export default Navbar
